Verenigde Staten
Thriller / Actie
115 minuten

een verdomt goeie film

met Matt Damon, Julia Stiles en David Strathairn

Jason Bourne is de aan geheugenverlies lijdende spion, die toe is aan een volgende poging om meer te weten te komen over zijn 
eigen identiteit. Na een fatale schietpartij in Moskou reist Bourne de hele wereld af, van verscheidene steden in Europa, via 
Tanger (Marokko) naar New York, terwijl hij achtervolgd wordt door moordenaars van officiele en minder officiele groeperingen.
